  if (logAggregationStatusForApps == null
      || logAggregationStatusForApps.isEmpty()) {
    return;
  }
  maybeInitBuilder();
  this.logAggregationReportsForApps =
      new HashMap<ApplicationId, LogAggregationReport>();
